$(function () {
    // results slider
    $('.results-slider').owlCarousel({
        loop: true,
        margin: 0,
        dots: false,
        nav: true,
        smartSpeed: 700,
        navText: [
            "<img src='/img/angle_left.png'>",
            "<img src='/img/angle_right.png'>"
        ],
        responsiveClass: false,
        responsive: {
            0: {
                items: 1,
                nav: true,
                loop: true,
                navText: [
                    "<img src='/img/angle_left_m.png'>",
                    "<img src='/img/angle_right_m.png'>"
                ],
            },
            720: {
                items: 1,
                nav: true,
                loop: true,
                navText: [
                    "<img src='/img/angle_left_m.png'>",
                    "<img src='/img/angle_right_m.png'>"
                ],
            },
            1000: {
                items: 1,
                nav: true,
                loop: true,
            }
        },
    });

    $('.specialists-slider').owlCarousel({
        loop: true,
        margin: 0,
        dots: false,
        nav: true,
        smartSpeed: 700,
        navText: [
            "<img src='/img/angle_left.png'>",
            "<img src='/img/angle_right.png'>"
        ],
        responsiveClass: true,
        responsive: {
            0: {
                items: 3,
                nav: true,
                loop: true,
            },
            1200: {
                items: 4,
                nav: true,
                loop: true,
            }
        }
    });


    $('.testimonials-slider').owlCarousel({
        loop: true,
        margin: 0,
        dots: false,
        nav: true,
        smartSpeed: 700,
        navText: [
            "<img src='/img/angle_left.png'>",
            "<img src='/img/angle_right.png'>"
        ],
        responsiveClass: true,
        responsive: {
            0: {
                items: 1,
                nav: true,
                loop: true,
                navText: [
                    "<img src='/img/angle_left_m.png'>",
                    "<img src='/img/angle_right_m.png'>"
                ],
            },
            720: {
                items: 2,
                nav: true,
                loop: true,
                navText: [
                    "<img src='/img/angle_left_m.png'>",
                    "<img src='/img/angle_right_m.png'>"
                ],
            },
            1100: {
                items: 2,
                nav: true,
                loop: true,
            }
        }
    });


    $('.contacts_team_slider').owlCarousel({
        loop: true,
        margin: 0,
        dots: false,
        nav: true,
        smartSpeed: 700,
        navText: [
            "<img src='/img/angle_left.png'>",
            "<img src='/img/angle_right.png'>"
        ],
        responsiveClass: false,
        responsive: {
            0: {
                items: 3,
                nav: true,
                loop: true,
            },
            600: {
                items: 3,
                nav: true,
                loop: true,
            },
            1000: {
                items: 3,
                nav: true,
                loop: true,
            }
        }
    });






    // ------------------------------------------------------- //
    // Scroll Top Button
    // ------------------------------------------------------- //
    $('#scrollTop').on('click', function () {
        $('html, body').animate({ scrollTop: 0}, 1000);
    });

    var c, currentScrollTop = 0,
        navbar = $('.navbar');
    $(window).on('scroll', function () {

        // Navbar functionality
        var a = $(window).scrollTop(), b = navbar.height();

        currentScrollTop = a;
        if (c < currentScrollTop && a > b + b) {
            navbar.addClass("scrollUp");
        } else if (c > currentScrollTop && !(a <= b)) {
            navbar.removeClass("scrollUp");
        }
        c = currentScrollTop;


        if ($(window).scrollTop() >= 2000) {
            $('#scrollTop').addClass('active');
        } else {
            $('#scrollTop').removeClass('active');
        }
    });


    // ---------------------------------------------------------- //
    // Preventing URL update on navigation link click
    // ---------------------------------------------------------- //
    $('.link-scroll').on('click', function (e) {
        var anchor = $(this);
        $('html, body').stop().animate({
            scrollTop: $(anchor.attr('href')).offset().top
        }, 1000);
        e.preventDefault();
    });

    // ---------------------------------------------------------- //
    // Preventing URL update on navigation link click
    // ---------------------------------------------------------- //
    $('.link-scroll-m').on('click', function (e) {
        var anchor = $(this);
        $('html, body').stop().animate({
            scrollTop: $(anchor.attr('href')).offset().top-80
        }, 0);
        e.preventDefault();
    });



    // ---------------------------------------------------------- //
    // Scroll Spy
    // ---------------------------------------------------------- //
    $('body').scrollspy({
        target: '#navbarSupportedContent',
        offset: 80
    });

    // ------------------------------------------------------- //
    // Navbar Toggler Button
    // ------------------------------------------------------- //
    $('.navbar .navbar-toggler').on('click', function () {
        $(this).toggleClass('active');
    });
});




